import React from 'react';
import Background from './components/background.js'
import Main from './Main'
import './App.scss';
import {
    BrowserRouter as Router,

    Route,
} from "react-router-dom";

class App extends React.Component {
    render() {
        return <>
            <Background />
            <Router>
                <Main />
            </Router>
        </>
    }
}

export default App;
